INSERT INTO `tbl_news` (`news_id`, `news_title_en`, `news_title_kh`, `news_title_cn`, `news_image`, `news_description_en`, `news_description_kh`, `news_description_cn`, `news_detail_en`, `news_detail_kh`, `news_detail_cn`, `news_type_id`, `news_views`, `news_posted_by`, `news_created_at`, `news_updated_at`, `news_other`) VALUES
(0, 'ក្រសួងសុខាភិបាល  សូមជូនព័ត៌មានដល់សាធារណជន', 'ក្រសួងសុខាភិបាល  សូមជូនព័ត៌មានដល់សាធារណជន', 'ក្រសួងសុខាភិបាល  សូមជូនព័ត៌មានដល់សាធារណជន', '20210226_8920_153656467_3800852749953803_5767312162063707483_n.jpg', 'ក្រសួងសុខាភិបាល  សូមជូនព័ត៌មានដល់សាធារណជន', 'ក្រសួងសុខាភិបាល  សូមជូនព័ត៌មានដល់សាធារណជន', 'ក្រសួងសុខាភិបាល  សូមជូនព័ត៌មានដល់សាធារណជន', '<p>ក្រសួងសុខាភិបាល សូមជូនព័ត៌មានដល់សាធារណជន ដូចខាងក្រោមនេះ៖</p>\r\n\r\n<p>Ministry of Health (MoH) would like to inform the public as the following:</p>\r\n\r\n<p>ចំនួនអ្នកដែលស្ម័គ្រចិត្តចាក់វ៉ាក់សាំងកូវីដ-១៩ (Sinopharm Beijing Institute of Biological Products) ពីថ្ងៃទី១០ ដល់ថ្ងៃទី២៥ ខែកុម្ភ: ឆ្នាំ២០២១ ៖</p>\r\n\r\n<p>(Number of people voluntary for Covid-19 vaccination (Sinopharm Beijing Institute of Biological Products) from 10 &ndash; 25 February 2021):</p>\r\n\r\n<p>១. សរុបអ្នកមកចាក់វ៉ាក់សាំងកូវីដ-១៩ ៖ ១៦០៤៥នាក់ (ស្រី ៥៥៩៩នាក់) ។</p>\r\n\r\n<p>(Number of voluntaries came for vaccination from 10 &ndash; 25 February 2021: 16045 persons (Female: 5599)</p>\r\n\r\n<p>២. អ្នកបានចាក់វ៉ាក់សាំងរួច៖ ១៣១០១នាក់ (ស្រី ៤០៧៦នាក់)។</p>\r\n\r\n<p>(Number of people vaccinated: 13101 persons (Female: 4076)</p>\r\n\r\n<p>៣. អ្នកដែលគ្រូពេទ្យមិនអនុញ្ញាតឲ្យចាក់៖ ២៩៤៤នាក់ (ស្រី ១៥២៣នាក់)។</p>\r\n\r\n<p>(Number of people not allow for vaccination due to health-related problems: 2944 persons (Female: 1523)</p>\r\n\r\n<p>លោកជំទាវវេជ្ជបណ្ឌិត ឱ វណ្ណឌីន រដ្ឋលេខាធិការ និងជាអ្នកនាំពាក្យក្រសួងសុខាភិបាលកម្ពុជា</p>\r\n\r\n<p>H.E. Dr. Or Vandine Secretary of State and Spokesperson of MoH of Cambodia</p>\r\n ', '<p>ក្រសួងសុខាភិបាល សូមជូនព័ត៌មានដល់សាធារណជន ដូចខាងក្រោមនេះ៖</p>\r\n\r\n<p>Ministry of Health (MoH) would like to inform the public as the following:</p>\r\n\r\n<p>ចំនួនអ្នកដែលស្ម័គ្រចិត្តចាក់វ៉ាក់សាំងកូវីដ-១៩ (Sinopharm Beijing Institute of Biological Products) ពីថ្ងៃទី១០ ដល់ថ្ងៃទី២៥ ខែកុម្ភ: ឆ្នាំ២០២១ ៖</p>\r\n\r\n<p>(Number of people voluntary for Covid-19 vaccination (Sinopharm Beijing Institute of Biological Products) from 10 &ndash; 25 February 2021):</p>\r\n\r\n<p>១. សរុបអ្នកមកចាក់វ៉ាក់សាំងកូវីដ-១៩ ៖ ១៦០៤៥នាក់ (ស្រី ៥៥៩៩នាក់) ។</p>\r\n\r\n<p>(Number of voluntaries came for vaccination from 10 &ndash; 25 February 2021: 16045 persons (Female: 5599)</p>\r\n\r\n<p>២. អ្នកបានចាក់វ៉ាក់សាំងរួច៖ ១៣១០១នាក់ (ស្រី ៤០៧៦នាក់)។</p>\r\n\r\n<p>(Number of people vaccinated: 13101 persons (Female: 4076)</p>\r\n\r\n<p>៣. អ្នកដែលគ្រូពេទ្យមិនអនុញ្ញាតឲ្យចាក់៖ ២៩៤៤នាក់ (ស្រី ១៥២៣នាក់)។</p>\r\n\r\n<p>(Number of people not allow for vaccination due to health-related problems: 2944 persons (Female: 1523)</p>\r\n\r\n<p>លោកជំទាវវេជ្ជបណ្ឌិត ឱ វណ្ណឌីន រដ្ឋលេខាធិការ និងជាអ្នកនាំពាក្យក្រសួងសុខាភិបាលកម្ពុជា</p>\r\n\r\n<p>H.E. Dr. Or Vandine Secretary of State and Spokesperson of MoH of Cambodia</p>\r\n ', '<p>ក្រសួងសុខាភិបាល សូមជូនព័ត៌មានដល់សាធារណជន ដូចខាងក្រោមនេះ៖</p>\r\n\r\n<p>Ministry of Health (MoH) would like to inform the public as the following:</p>\r\n\r\n<p>ចំនួនអ្នកដែលស្ម័គ្រចិត្តចាក់វ៉ាក់សាំងកូវីដ-១៩ (Sinopharm Beijing Institute of Biological Products) ពីថ្ងៃទី១០ ដល់ថ្ងៃទី២៥ ខែកុម្ភ: ឆ្នាំ២០២១ ៖</p>\r\n\r\n<p>(Number of people voluntary for Covid-19 vaccination (Sinopharm Beijing Institute of Biological Products) from 10 &ndash; 25 February 2021):</p>\r\n\r\n<p>១. សរុបអ្នកមកចាក់វ៉ាក់សាំងកូវីដ-១៩ ៖ ១៦០៤៥នាក់ (ស្រី ៥៥៩៩នាក់) ។</p>\r\n\r\n<p>(Number of voluntaries came for vaccination from 10 &ndash; 25 February 2021: 16045 persons (Female: 5599)</p>\r\n\r\n<p>២. អ្នកបានចាក់វ៉ាក់សាំងរួច៖ ១៣១០១នាក់ (ស្រី ៤០៧៦នាក់)។</p>\r\n\r\n<p>(Number of people vaccinated: 13101 persons (Female: 4076)</p>\r\n\r\n<p>៣. អ្នកដែលគ្រូពេទ្យមិនអនុញ្ញាតឲ្យចាក់៖ ២៩៤៤នាក់ (ស្រី ១៥២៣នាក់)។</p>\r\n\r\n<p>(Number of people not allow for vaccination due to health-related problems: 2944 persons (Female: 1523)</p>\r\n\r\n<p>លោកជំទាវវេជ្ជបណ្ឌិត ឱ វណ្ណឌីន រដ្ឋលេខាធិការ និងជាអ្នកនាំពាក្យក្រសួងសុខាភិបាលកម្ពុជា</p>\r\n\r\n<p>H.E. Dr. Or Vandine Secretary of State and Spokesperson of MoH of Cambodia</p>\r\n ', 0, '0', 1, '2021-02-26 08:01:25', '0000-00-00', ''),
(18, 'អាណិត​ស្ត្រី​ម្នាក់​នេះ មិនដឹង​យ៉ាងម៉េច​ក្រាលកន្ទេល​កណ្តាលផ្លូវ', 'អាណិត​ស្ត្រី​ម្នាក់​នេះ មិនដឹង​យ៉ាងម៉េច​ក្រាលកន្ទេល​កណ្តាលផ្លូវ', 'អាណិត​ស្ត្រី​ម្នាក់​នេះ មិនដឹង​យ៉ាងម៉េច​ក្រាលកន្ទេល​កណ្តាលផ្លូវ', '20180510_9702_cocola can.png', 'រាជធានី​ភ្នំពេញ ៖ ស្ត្រី​វ័យក្មេង​ម្នាក់​មាន​សតិ​មិន​ប្រក្រតី​យក​កន្ទេល​មក​ក្រាល​ដេក​តាម​ផ្លូវ ត្រូវ​បាន​ប្រជា​ពល រដ្ឋ​រាយការណ៍​ទៅ​សមត្ថកិច្ច​មូលដ្ឋាន ចុះ​មក​យក​ទៅ​ឲ្យ​មន្ទីរ​សង្គមកិច្ច​ជួយ​មើលថែ ហេតុការណ៍​នេះ​កើតឡើង​កាលពី​វេលា​ម៉ោង​៩​និង​១០​នាទី​យប់ ថ្ងៃ', 'រាជធានី​ភ្នំពេញ ៖ ស្ត្រី​វ័យក្មេង​ម្នាក់​មាន​សតិ​មិន​ប្រក្រតី​យក​កន្ទេល​មក​ក្រាល​ដេក​តាម​ផ្លូវ ត្រូវ​បាន​ប្រជា​ពល រដ្ឋ​រាយការណ៍​ទៅ​សមត្ថកិច្ច​មូលដ្ឋាន ចុះ​មក​យក​ទៅ​ឲ្យ​មន្ទីរ​សង្គមកិច្ច​ជួយ​មើលថែ ហេតុការណ៍​នេះ​កើតឡើង​កាលពី​វេលា​ម៉ោង​៩​និង​១០​នាទី​យប់ ថ្ងៃ', 'រាជធានី​ភ្នំពេញ ៖ ស្ត្រី​វ័យក្មេង​ម្នាក់​មាន​សតិ​មិន​ប្រក្រតី​យក​កន្ទេល​មក​ក្រាល​ដេក​តាម​ផ្លូវ ត្រូវ​បាន​ប្រជា​ពល រដ្ឋ​រាយការណ៍​ទៅ​សមត្ថកិច្ច​មូលដ្ឋាន ចុះ​មក​យក​ទៅ​ឲ្យ​មន្ទីរ​សង្គមកិច្ច​ជួយ​មើលថែ ហេតុការណ៍​នេះ​កើតឡើង​កាលពី​វេលា​ម៉ោង​៩​និង​១០​នាទី​យប់ ថ្ងៃ', '<p><img alt=\"\" src=\"/plugin/ckeditor_4.7.0_full/kcfinder-master/upload/images/news/2018-04-19/1679091c5a880faf6fb5e6087eb1b2dc-68.jpg\" style=\"width:100%\" /></p>\r\n\r\n<p>រាជធានី​ភ្នំពេញ ៖ ស្ត្រី​វ័យក្មេង​ម្នាក់​មាន​សតិ​មិន​ប្រក្រតី​យក​កន្ទេល​មក​ក្រាល​ដេក​តាម​ផ្លូវ ត្រូវ​បាន​ប្រជា​ពល រដ្ឋ​រាយការណ៍​ទៅ​សមត្ថកិច្ច​មូលដ្ឋាន ចុះ​មក​យក​ទៅ​ឲ្យ​មន្ទីរ​សង្គមកិច្ច​ជួយ​មើលថែ ហេតុការណ៍​នេះ​កើតឡើង​កាលពី​វេលា​ម៉ោង​៩​និង​១០​នាទី​យប់ ថ្ងៃ​ទី​១៩ ខែមេសា ឆ្នាំ​២០១៨ តាម​បណ្តោយ​ផ្លូវ​២០០៤ ស្ថិត​ក្នុង​សង្កាត់​អូ​បែក​ក្អម ខណ្ឌ​សែន​សុខ ។</p>\r\n\r\n<p><img alt=\"\" src=\"/plugin/ckeditor_4.7.0_full/kcfinder-master/upload/images/news/2018-04-19/Animals--Sad-Kitty--4004.jpg\" style=\"width:100%\" /></p>\r\n\r\n<p>បើ​តាម​ប្រភព​ព័ត៌មាន​ពី​សមត្ថកិច្ច​មូលដ្ឋាន​បាន​ឲ្យ​ដឹង​ថា មុន​ពេល​កើតហេតុ​មាន​ប្រជាពលរដ្ឋ​បាន​រាយការណ៍​ប្រាប់​ថា ប្រទះ​ឃើញ​ស្ត្រី​មិន​ស្គាល់​អត្តសញ្ញាណ​ម្នាក់​វ័យ​ជាង​២០​ឆ្នាំ បាន​ដើរ​តាម​ផ្លូវ​ដោយ​មាន​ទូល​កន្ទេល​មួយ​ជាប់​នឹង​ខ្លួន​ផង​ដែរ ដើរ​បណ្តើរ​និយាយ​ម្នាក់ឯង​បណ្តើរ​ក្នុង​សភាព​ដូច​ជា​មាន​សតិ​មិន​ប្រក្រតី ។<br />\r\nលុះ​ដើរមក​ដល់​ចំណុច​កើតហេតុ ស្រាប់តែ​នារី​រូប​នោះ​បាន​ក្រាលកន្ទេល​ដេក​តាម​ដងផ្លូវ​ដោយ​មិន​មានការ​ព្រួយបារម្ភ​ពី​សុវត្ថិភាព​យានយន្ត​ដែល​ធ្វើ​ដំណើរ​តាម​ដងផ្លូវ​បើក​បុក​នោះ​ទេ ។</p>\r\n\r\n<p><img alt=\"\" src=\"/plugin/ckeditor_4.7.0_full/kcfinder-master/upload/images/news/2018-04-19/a72b72ab62e5510e932d3cd2fcdcd3bc.jpg\" style=\"width:100%\" /></p>\r\n\r\n<p>ប្រជាពលរដ្ឋ​ឃើញ​បែប​នេះ​ខ្លាច​មាន​យានជំនិះ​បើក​ទៅ​បុក​រង​របួស ឬ​បាត់បង់​ជីវិត​ក៏​បាន​រាយការណ៍​ប្រាប់​កម្លាំង​សមត្ថកិច្ច​មូលដ្ឋាន​ចុះ​មក​ជួយ​អន្តរាគមន៍​នាំ​ស្ត្រី​វ័យក្មេង​នោះ​ទៅ​សួរនាំ​នៅ​ប៉ុស្តិ៍ ដើម្បី​រក​សាច់ញាតិ​ឲ្យ​មក​ទទួលយក​ត្រឡប់​ទៅ​វិញ ។</p>\r\n\r\n<p>ក្រោយ​ពេល​កើតហេតុ​ដោយ​សមត្ថកិច្ច​មិន​អាច​ធ្វើការ​សួរនាំ​រក​សាច់ញាតិ​បាន​ទេ ព្រោះ​ស្ត្រី​រូប​នោះ​មាន​សតិ​មិន​ប្រក្រតី​សួរនាំ​មិន​ចេញ​ទើប​សមត្ថកិច្ច​ប៉ុស្តិ៍​នគរបាល​រដ្ឋបាល​អូ​បែក​ក្អម​បាន​បញ្ជូន​នាង​ទៅ​កាន់​មន្ទីរ​សង្គមកិច្ច ដើម្បី​ឲ្យ​គេ​មើលថែ​ទាំ និង​ធ្វើការ<br />\r\nព្យាបាល ៕</p>\r\n', '<p><img alt=\"\" src=\"/plugin/ckeditor_4.7.0_full/kcfinder-master/upload/images/news/2018-04-19/1679091c5a880faf6fb5e6087eb1b2dc-68.jpg\" style=\"width:100%\" /></p>\r\n\r\n<p>រាជធានី​ភ្នំពេញ ៖ ស្ត្រី​វ័យក្មេង​ម្នាក់​មាន​សតិ​មិន​ប្រក្រតី​យក​កន្ទេល​មក​ក្រាល​ដេក​តាម​ផ្លូវ ត្រូវ​បាន​ប្រជា​ពល រដ្ឋ​រាយការណ៍​ទៅ​សមត្ថកិច្ច​មូលដ្ឋាន ចុះ​មក​យក​ទៅ​ឲ្យ​មន្ទីរ​សង្គមកិច្ច​ជួយ​មើលថែ ហេតុការណ៍​នេះ​កើតឡើង​កាលពី​វេលា​ម៉ោង​៩​និង​១០​នាទី​យប់ ថ្ងៃ​ទី​១៩ ខែមេសា ឆ្នាំ​២០១៨ តាម​បណ្តោយ​ផ្លូវ​២០០៤ ស្ថិត​ក្នុង​សង្កាត់​អូ​បែក​ក្អម ខណ្ឌ​សែន​សុខ ។</p>\r\n\r\n<p><img alt=\"\" src=\"/plugin/ckeditor_4.7.0_full/kcfinder-master/upload/images/news/2018-04-19/Animals--Sad-Kitty--4004.jpg\" style=\"width:100%\" /></p>\r\n\r\n<p>បើ​តាម​ប្រភព​ព័ត៌មាន​ពី​សមត្ថកិច្ច​មូលដ្ឋាន​បាន​ឲ្យ​ដឹង​ថា មុន​ពេល​កើតហេតុ​មាន​ប្រជាពលរដ្ឋ​បាន​រាយការណ៍​ប្រាប់​ថា ប្រទះ​ឃើញ​ស្ត្រី​មិន​ស្គាល់​អត្តសញ្ញាណ​ម្នាក់​វ័យ​ជាង​២០​ឆ្នាំ បាន​ដើរ​តាម​ផ្លូវ​ដោយ​មាន​ទូល​កន្ទេល​មួយ​ជាប់​នឹង​ខ្លួន​ផង​ដែរ ដើរ​បណ្តើរ​និយាយ​ម្នាក់ឯង​បណ្តើរ​ក្នុង​សភាព​ដូច​ជា​មាន​សតិ​មិន​ប្រក្រតី ។<br />\r\nលុះ​ដើរមក​ដល់​ចំណុច​កើតហេតុ ស្រាប់តែ​នារី​រូប​នោះ​បាន​ក្រាលកន្ទេល​ដេក​តាម​ដងផ្លូវ​ដោយ​មិន​មានការ​ព្រួយបារម្ភ​ពី​សុវត្ថិភាព​យានយន្ត​ដែល​ធ្វើ​ដំណើរ​តាម​ដងផ្លូវ​បើក​បុក​នោះ​ទេ ។</p>\r\n\r\n<p><img alt=\"\" src=\"/plugin/ckeditor_4.7.0_full/kcfinder-master/upload/images/news/2018-04-19/a72b72ab62e5510e932d3cd2fcdcd3bc.jpg\" style=\"width:100%\" /></p>\r\n\r\n<p>ប្រជាពលរដ្ឋ​ឃើញ​បែប​នេះ​ខ្លាច​មាន​យានជំនិះ​បើក​ទៅ​បុក​រង​របួស ឬ​បាត់បង់​ជីវិត​ក៏​បាន​រាយការណ៍​ប្រាប់​កម្លាំង​សមត្ថកិច្ច​មូលដ្ឋាន​ចុះ​មក​ជួយ​អន្តរាគមន៍​នាំ​ស្ត្រី​វ័យក្មេង​នោះ​ទៅ​សួរនាំ​នៅ​ប៉ុស្តិ៍ ដើម្បី​រក​សាច់ញាតិ​ឲ្យ​មក​ទទួលយក​ត្រឡប់​ទៅ​វិញ ។</p>\r\n\r\n<p>ក្រោយ​ពេល​កើតហេតុ​ដោយ​សមត្ថកិច្ច​មិន​អាច​ធ្វើការ​សួរនាំ​រក​សាច់ញាតិ​បាន​ទេ ព្រោះ​ស្ត្រី​រូប​នោះ​មាន​សតិ​មិន​ប្រក្រតី​សួរនាំ​មិន​ចេញ​ទើប​សមត្ថកិច្ច​ប៉ុស្តិ៍​នគរបាល​រដ្ឋបាល​អូ​បែក​ក្អម​បាន​បញ្ជូន​នាង​ទៅ​កាន់​មន្ទីរ​សង្គមកិច្ច ដើម្បី​ឲ្យ​គេ​មើលថែ​ទាំ និង​ធ្វើការ<br />\r\nព្យាបាល ៕</p>\r\n ', '<p><img alt=\"\" src=\"/plugin/ckeditor_4.7.0_full/kcfinder-master/upload/images/news/2018-04-19/1679091c5a880faf6fb5e6087eb1b2dc-68.jpg\" style=\"width:100%\" /></p>\r\n\r\n<p>រាជធានី​ភ្នំពេញ ៖ ស្ត្រី​វ័យក្មេង​ម្នាក់​មាន​សតិ​មិន​ប្រក្រតី​យក​កន្ទេល​មក​ក្រាល​ដេក​តាម​ផ្លូវ ត្រូវ​បាន​ប្រជា​ពល រដ្ឋ​រាយការណ៍​ទៅ​សមត្ថកិច្ច​មូលដ្ឋាន ចុះ​មក​យក​ទៅ​ឲ្យ​មន្ទីរ​សង្គមកិច្ច​ជួយ​មើលថែ ហេតុការណ៍​នេះ​កើតឡើង​កាលពី​វេលា​ម៉ោង​៩​និង​១០​នាទី​យប់ ថ្ងៃ​ទី​១៩ ខែមេសា ឆ្នាំ​២០១៨ តាម​បណ្តោយ​ផ្លូវ​២០០៤ ស្ថិត​ក្នុង​សង្កាត់​អូ​បែក​ក្អម ខណ្ឌ​សែន​សុខ ។</p>\r\n\r\n<p><img alt=\"\" src=\"/plugin/ckeditor_4.7.0_full/kcfinder-master/upload/images/news/2018-04-19/Animals--Sad-Kitty--4004.jpg\" style=\"width:100%\" /></p>\r\n\r\n<p>បើ​តាម​ប្រភព​ព័ត៌មាន​ពី​សមត្ថកិច្ច​មូលដ្ឋាន​បាន​ឲ្យ​ដឹង​ថា មុន​ពេល​កើតហេតុ​មាន​ប្រជាពលរដ្ឋ​បាន​រាយការណ៍​ប្រាប់​ថា ប្រទះ​ឃើញ​ស្ត្រី​មិន​ស្គាល់​អត្តសញ្ញាណ​ម្នាក់​វ័យ​ជាង​២០​ឆ្នាំ បាន​ដើរ​តាម​ផ្លូវ​ដោយ​មាន​ទូល​កន្ទេល​មួយ​ជាប់​នឹង​ខ្លួន​ផង​ដែរ ដើរ​បណ្តើរ​និយាយ​ម្នាក់ឯង​បណ្តើរ​ក្នុង​សភាព​ដូច​ជា​មាន​សតិ​មិន​ប្រក្រតី ។<br />\r\nលុះ​ដើរមក​ដល់​ចំណុច​កើតហេតុ ស្រាប់តែ​នារី​រូប​នោះ​បាន​ក្រាលកន្ទេល​ដេក​តាម​ដងផ្លូវ​ដោយ​មិន​មានការ​ព្រួយបារម្ភ​ពី​សុវត្ថិភាព​យានយន្ត​ដែល​ធ្វើ​ដំណើរ​តាម​ដងផ្លូវ​បើក​បុក​នោះ​ទេ ។</p>\r\n\r\n<p><img alt=\"\" src=\"/plugin/ckeditor_4.7.0_full/kcfinder-master/upload/images/news/2018-04-19/a72b72ab62e5510e932d3cd2fcdcd3bc.jpg\" style=\"width:100%\" /></p>\r\n\r\n<p>ប្រជាពលរដ្ឋ​ឃើញ​បែប​នេះ​ខ្លាច​មាន​យានជំនិះ​បើក​ទៅ​បុក​រង​របួស ឬ​បាត់បង់​ជីវិត​ក៏​បាន​រាយការណ៍​ប្រាប់​កម្លាំង​សមត្ថកិច្ច​មូលដ្ឋាន​ចុះ​មក​ជួយ​អន្តរាគមន៍​នាំ​ស្ត្រី​វ័យក្មេង​នោះ​ទៅ​សួរនាំ​នៅ​ប៉ុស្តិ៍ ដើម្បី​រក​សាច់ញាតិ​ឲ្យ​មក​ទទួលយក​ត្រឡប់​ទៅ​វិញ ។</p>\r\n\r\n<p>ក្រោយ​ពេល​កើតហេតុ​ដោយ​សមត្ថកិច្ច​មិន​អាច​ធ្វើការ​សួរនាំ​រក​សាច់ញាតិ​បាន​ទេ ព្រោះ​ស្ត្រី​រូប​នោះ​មាន​សតិ​មិន​ប្រក្រតី​សួរនាំ​មិន​ចេញ​ទើប​សមត្ថកិច្ច​ប៉ុស្តិ៍​នគរបាល​រដ្ឋបាល​អូ​បែក​ក្អម​បាន​បញ្ជូន​នាង​ទៅ​កាន់​មន្ទីរ​សង្គមកិច្ច ដើម្បី​ឲ្យ​គេ​មើលថែ​ទាំ និង​ធ្វើការ<br />\r\nព្យាបាល ៕</p>\r\n ', 0, '0', 2, '2018-04-20 05:00:40', '0000-00-00', ''),
(19, 'សត្វ​ដាយណូស័រ​មក​ដល់​កន្លែង​មនុស្ស​រស់​នៅ​ក្នុង​ Trailer ថ្មី', 'សត្វ​ដាយណូស័រ​មក​ដល់​កន្លែង​មនុស្ស​រស់​នៅ​ក្នុង​ Trailer ថ្មី \"Jurassic World: Fallen Kingdom”', 'សត្វ​ដាយណូស័រ​មក​ដល់​កន្លែង​មនុស្ស​រស់​នៅ​ក្នុង​ Trailer ថ្មី \"Jurassic World: Fallen Kingdom”', '20180510_3863_cocacola bottle.jpg', 'នៅ​ក្នុង​វីដេអូ​ Trailer ថ្មី​របស់​រឿង \"Jurassic World: Fallen Kingdom” ដែល​ទើប​នឹង​បញ្ចេញ​ថ្មីៗ​នេះ​បាន​បង្ហាញ​ឲ្យ​ឃើញ​កាន់​តែ​ច្បាស់​ពី​អនាគត​របស់​សត្វ​ដាយណូស័រ​ទាំង​អស់​បន្ទាប់​ពី \"Jurassic Park” ​ត្រូវ​បំផ្លាញ​កាល​ពី​វគ្គ​មុន។ ក្នុង​វីដេអូ​រយៈ​ពេល ២​ន', 'នៅ​ក្នុង​វីដេអូ​ Trailer ថ្មី​របស់​រឿង \"Jurassic World: Fallen Kingdom” ដែល​ទើប​នឹង​បញ្ចេញ​ថ្មីៗ​នេះ​បាន​បង្ហាញ​ឲ្យ​ឃើញ​កាន់​តែ​ច្បាស់​ពី​អនាគត​របស់​សត្វ​ដាយណូស័រ​ទាំង​អស់​បន្ទាប់​ពី \"Jurassic Park” ​ត្រូវ​បំផ្លាញ​កាល​ពី​វគ្គ​មុន។ ក្នុង​វីដេអូ​រយៈ​ពេល ២​ន', 'នៅ​ក្នុង​វីដេអូ​ Trailer ថ្មី​របស់​រឿង \"Jurassic World: Fallen Kingdom” ដែល​ទើប​នឹង​បញ្ចេញ​ថ្មីៗ​នេះ​បាន​បង្ហាញ​ឲ្យ​ឃើញ​កាន់​តែ​ច្បាស់​ពី​អនាគត​របស់​សត្វ​ដាយណូស័រ​ទាំង​អស់​បន្ទាប់​ពី \"Jurassic Park” ​ត្រូវ​បំផ្លាញ​កាល​ពី​វគ្គ​មុន។ ក្នុង​វីដេអូ​រយៈ​ពេល ២​ន', '<p>នៅ​ក្នុង​វីដេអូ​ Trailer ថ្មី​របស់​រឿង &quot;Jurassic World: Fallen Kingdom&rdquo; ដែល​ទើប​នឹង​បញ្ចេញ​ថ្មីៗ​នេះ​បាន​បង្ហាញ​ឲ្យ​ឃើញ​កាន់​តែ​ច្បាស់​ពី​អនាគត​របស់​សត្វ​ដាយណូស័រ​ទាំង​អស់​បន្ទាប់​ពី &quot;Jurassic Park&rdquo; ​ត្រូវ​បំផ្លាញ​កាល​ពី​វគ្គ​មុន។ ក្នុង​វីដេអូ​រយៈ​ពេល ២​នាទី​និង​៣០​វិនាទី​នេះ បាន​បង្ហាញ​ពី​តារា​សម្ដែង Chris Pratt និង Bryce Dallas Howard ត្រលប់​មក​ដើរ​តួ​ជា​តួអង្គ​សំខាន់​ម្ដង​ទៀត។</p>\r\n\r\n<p><img alt=\"\" src=\"/plugin/ckeditor_4.7.0_full/kcfinder-master/upload/images/news/2018-04-19/5ad8470d00f16_1524123360_large.jpg\" style=\"width:100%\" /></p>\r\n\r\n<p>លោក Chris Pratt បាន​ប្រាប់​ទស្សនាវដ្ដី Entertainment Weekly ថា &quot;នេះ​គឺ​ជា​អ្វី​ដែល​ខុស​ពី​មុន​ ហើយ​ក៏​ជា​អ្វី​ដែល​សំខាន់​សម្រាប់​រឿង​ទាំង​បី​វគ្គ​ផង​ដែរ។&quot;</p>\r\n\r\n<p>&ldquo;Fallen Kingdom&rdquo; គឺ​ជា​ភាពយន្ត​វគ្គ​ទី​២ បន្ទាប់​ពី​ &quot;Jurassic World&rdquo; បាន​ដាក់​បញ្ចាំង​កាល​ពី​ឆ្នាំ ២០១៥។ ភាពយន្ត​វគ្គ​ថ្មី​នេះ ដឹក​នាំ​ដោយ​លោក J.A. Bayona ដោយ​បាន​ចូលរួម​សម្ដែង​ដោយ Ted Levine, Geraldine Chaplin, James Cromwell, Jeff Goldblum និង B.D. Wong។</p>\r\n\r\n<p><img alt=\"\" src=\"/plugin/ckeditor_4.7.0_full/kcfinder-master/upload/images/news/2018-04-19/5ad8470c7b8be_1524123360_large.jpg\" style=\"width:100%\" /></p>\r\n\r\n<p>ភាពយន្ត​នេះ​នឹង​ចាប់​ដាក់​បញ្ចាំង​នៅ​ថ្ងៃ​ទី ២២​ខែ​មិថុនា​ឆ្នាំ ២០១៨​ នេះ​នៅ​សហរដ្ឋ​អាមេរិក៕</p>\r\n', '<p>នៅ​ក្នុង​វីដេអូ​ Trailer ថ្មី​របស់​រឿង &quot;Jurassic World: Fallen Kingdom&rdquo; ដែល​ទើប​នឹង​បញ្ចេញ​ថ្មីៗ​នេះ​បាន​បង្ហាញ​ឲ្យ​ឃើញ​កាន់​តែ​ច្បាស់​ពី​អនាគត​របស់​សត្វ​ដាយណូស័រ​ទាំង​អស់​បន្ទាប់​ពី &quot;Jurassic Park&rdquo; ​ត្រូវ​បំផ្លាញ​កាល​ពី​វគ្គ​មុន។ ក្នុង​វីដេអូ​រយៈ​ពេល ២​នាទី​និង​៣០​វិនាទី​នេះ បាន​បង្ហាញ​ពី​តារា​សម្ដែង Chris Pratt និង Bryce Dallas Howard ត្រលប់​មក​ដើរ​តួ​ជា​តួអង្គ​សំខាន់​ម្ដង​ទៀត។</p>\r\n\r\n<p><img alt=\"\" src=\"/plugin/ckeditor_4.7.0_full/kcfinder-master/upload/images/news/2018-04-19/5ad8470d00f16_1524123360_large.jpg\" style=\"width:100%\" /></p>\r\n\r\n<p>លោក Chris Pratt បាន​ប្រាប់​ទស្សនាវដ្ដី Entertainment Weekly ថា &quot;នេះ​គឺ​ជា​អ្វី​ដែល​ខុស​ពី​មុន​ ហើយ​ក៏​ជា​អ្វី​ដែល​សំខាន់​សម្រាប់​រឿង​ទាំង​បី​វគ្គ​ផង​ដែរ។&quot;</p>\r\n\r\n<p>&ldquo;Fallen Kingdom&rdquo; គឺ​ជា​ភាពយន្ត​វគ្គ​ទី​២ បន្ទាប់​ពី​ &quot;Jurassic World&rdquo; បាន​ដាក់​បញ្ចាំង​កាល​ពី​ឆ្នាំ ២០១៥។ ភាពយន្ត​វគ្គ​ថ្មី​នេះ ដឹក​នាំ​ដោយ​លោក J.A. Bayona ដោយ​បាន​ចូលរួម​សម្ដែង​ដោយ Ted Levine, Geraldine Chaplin, James Cromwell, Jeff Goldblum និង B.D. Wong។</p>\r\n\r\n<p><img alt=\"\" src=\"/plugin/ckeditor_4.7.0_full/kcfinder-master/upload/images/news/2018-04-19/5ad8470c7b8be_1524123360_large.jpg\" style=\"width:100%\" /></p>\r\n\r\n<p>ភាពយន្ត​នេះ​នឹង​ចាប់​ដាក់​បញ្ចាំង​នៅ​ថ្ងៃ​ទី ២២​ខែ​មិថុនា​ឆ្នាំ ២០១៨​ នេះ​នៅ​សហរដ្ឋ​អាមេរិក៕</p>\r\n ', '<p>នៅ​ក្នុង​វីដេអូ​ Trailer ថ្មី​របស់​រឿង &quot;Jurassic World: Fallen Kingdom&rdquo; ដែល​ទើប​នឹង​បញ្ចេញ​ថ្មីៗ​នេះ​បាន​បង្ហាញ​ឲ្យ​ឃើញ​កាន់​តែ​ច្បាស់​ពី​អនាគត​របស់​សត្វ​ដាយណូស័រ​ទាំង​អស់​បន្ទាប់​ពី &quot;Jurassic Park&rdquo; ​ត្រូវ​បំផ