INSERT INTO `tbl_slider` (`sd_id`, `sd_title_en`, `sd_title_kh`, `sd_title_cn`, `sd_image`, `sd_description_en`, `sd_description_kh`, `sd_description_cn`, `sd_detail_en`, `sd_detail_kh`, `sd_detail_cn`, `sd_index`, `sd_active`, `sd_created_at`, `sd_updated_at`, `sd_note`) VALUES
(2, 'ប្រាសាទអង្គរវត្ត', '.', '.', '20180420_3838_Angkor4.jpg', '.', '...', '...', '<p><img alt=\"\" src=\"/www/Project/project_OCIC/project_OCIC/plugin/ckeditor_4.7.0_full/kcfinder-master/upload/images/diamond_island/CASA_-_Exterior_O1JKr6S1.jpg\" style=\"width:100%\" /></p>\r\n\r\n<p>Located by the Tonle Bassac River, Diamond Island City covers more than 100 hectares in the very soul and strategic location of Phnom Penh, embodying invaluable fame and pride of Cambodia. In 2006, the Khmer-Canadian OCIC (Overseas Cambodian Investment Corporation) signed an agreement with the government of Phnom Penh to develop and manage the island which was previously known &ldquo;Koh Klong&rdquo;, &nbsp;a less audible place where no one person dreams of going there. However, to the date, the city become the &ldquo;diamond of Phnom Penh&rdquo; very much dominated by hundred-million-dollar cost construction projects.&nbsp;</p>\r\n\r\n<p><img alt=\"\" src=\"/www/Project/project_OCIC/project_OCIC/plugin/ckeditor_4.7.0_full/kcfinder-master/upload/images/diamond_island/citihall1.jpg\" style=\"width:100%\" /><br />\r\nKoh Pich is stabbed deeply in the top of mind of our people, especially those who are living in the capital city. The peninsula represents economic prosperity, pride and excitement. How the location is manufactured by the dazzling architectural concept of OCIC articulates the lucrative area where love begins, friendship develops, social patriot embarks, happiness begins, knowledge sharing exchanges and investment occurs to creates prestigious lifelike economic vein of the city center.&nbsp;</p>\r\n\r\n<p><img alt=\"\" src=\"/www/Project/project_OCIC/project_OCIC/plugin/ckeditor_4.7.0_full/kcfinder-master/upload/images/diamond_island/elysee4.jpg\" style=\"width:100%\" /><br />\r\nSitting at the most panoramic views of the city, Diamond Island City is a remarkable host region to active tourism spot, high-end residential area, entertainment, exhibition centers, retail district, wedding hall, sporting activity, multi-purpose commercial building and other prominent services. The future of this satellite city will more civilized, forwarding and increasingly popular to become the economic and tourism hub in ASEAN region.</p>\r\n\r\n<p><img alt=\"\" src=\"/www/Project/project_OCIC/project_OCIC/plugin/ckeditor_4.7.0_full/kcfinder-master/upload/images/diamond_island/maxresdefault.jpg\" style=\"width:100%\" /></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><br />\r\n&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n', 'Located by the Tonle Bassac River, Diamond Island City covers more than​ 100 hectares in the very soul and strategic location of Phnom Penh, embodying invaluable fame and pride of Cambodia. In 2006, the Khmer-Canadian OCIC (Overseas Cambodian Investment Corporation) signed an agreement with the government of Phnom Penh to develop and manage the island which was previously known “Koh Klong”, a less audible place where no one person dreams of going there. However, to the date, the city become the “diamond of Phnom Penh” very much dominated by hundred-million-dollar cost construction projects.\r\nKoh Pich is stabbed deeply in the top of mind of our people, especially those who are living in the capital city. The peninsula represents economic prosperity, pride and excitement. How the location is manufactured by the dazzling architectural concept of OCIC articulates the lucrative area where love begins, friendship develops, social patriot embarks, happiness begins, knowledge sharing exchanges and investment occurs to creates prestigious lifelike economic vein of the city center.\r\nSitting at the most panoramic views of the city, Diamond Island City is a remarkable host region to active tourism spot, high-end residential area, entertainment, exhibition centers, retail district, wedding hall, sporting activity, multi-purpose commercial building and other prominent services. The future of this satellite city will more civilized, forwarding and increasingly popular to become the economic and tourism hub in ASEAN region.', 'Located by the Tonle Bassac River, Diamond Island City covers more than​ 100 hectares in the very soul and strategic location of Phnom Penh, embodying invaluable fame and pride of Cambodia. In 2006, the Khmer-Canadian OCIC (Overseas Cambodian Investment Corporation) signed an agreement with the government of Phnom Penh to develop and manage the island which was previously known “Koh Klong”, a less audible place where no one person dreams of going there. However, to the date, the city become the “diamond of Phnom Penh” very much dominated by hundred-million-dollar cost construction projects.\r\nKoh Pich is stabbed deeply in the top of mind of our people, especially those who are living in the capital city. The peninsula represents economic prosperity, pride and excitement. How the location is manufactured by the dazzling architectural concept of OCIC articulates the lucrative area where love begins, friendship develops, social patriot embarks, happiness begins, knowledge sharing exchanges and investment occurs to creates prestigious lifelike economic vein of the city center.\r\nSitting at the most panoramic views of the city, Diamond Island City is a remarkable host region to active tourism spot, high-end residential area, entertainment, exhibition centers, retail district, wedding hall, sporting activity, multi-purpose commercial building and other prominent services. The future of this satellite city will more civilized, forwarding and increasingly popular to become the economic and tourism hub in ASEAN region.', 0, '1', '2018-02-23 08:22:53', '2018-03-01', ''),
(3, 'វិមាន ឯករាជ្យ', '.', '.', '20180223_5996_2. Olympia City.png', '.', '..', '..', '<p>Developed by OCIC stretching on more than 3.9 hectares of total land area, Olympia city is located in the downtown of Phnom Penh whose location is bordered by the well-known Olympic Stadium in Khan 7 Makara, a vibrant, premium and financial business vicinity with easy and convenient walking access to the central business district and popular shopping destinations escorted by a number of well-off and middle class family.&nbsp;</p>\r\n\r\n<p><img alt=\"\" src=\"/www/Project/project_OCIC/project_OCIC/plugin/ckeditor_4.7.0_full/kcfinder-master/upload/images/oplympia_city/Issue002_Page_08_Image_0001.jpg\" style=\"width:100%\" /></p>\r\n\r\n<p>Olympia city is first large-scale high-rise development project, created to provide best shopping experience at the conjunction of vibrant financial street to reach the ultimately confident investment opportunity for financial merit and freedom. The city is covered by 1860 units of condominium, more than a hundred of shop house, 45-storey hotel, 38-storey office tower and a 7-storey of shopping mall, so we expect the population boom and high density in a very short future. In addition, the linkage of this city itself to other major streets of Phnom Penh indicate prominent additional factor driven for profitable merit as the following:&nbsp;</p>\r\n\r\n<p><img alt=\"\" src=\"/www/Project/project_OCIC/project_OCIC/plugin/ckeditor_4.7.0_full/kcfinder-master/upload/images/oplympia_city/Picture1.png\" style=\"width:100%\" /></p>\r\n\r\n<p>Czech Republic Blvd links us from Russian Blvd and &nbsp;Kampuchea Krom Blvd to Olympia City in which both streets &nbsp;are famous for business in fashion and lifestyle.</p>\r\n\r\n<p>Challe De Gualle is a crowed business road which links the area &nbsp;from central market to tourist attraction zones such as &nbsp;Riverfront, Royal Palace, Independence monument, National museum and Wat Phnom.&nbsp;</p>\r\n\r\n<p>Monireth Blvd is a crucial street which links us from the highly-rated commercial zone of Chamkamorn District passing through Olympia City forwarded to Monivong Blvd.&nbsp;</p>\r\n\r\n<p>Ouknha Tepphon is the busiest business road linked from the west side of Toul Kork District toward to&nbsp;Monivong Blvd where it links us to other vibrant business area. &nbsp; &nbsp;</p>\r\n\r\n<p>Considering about all of the factors motivated, it is where the future of yours and mine can shine beautifully.&nbsp;<br />\r\n&nbsp;</p>\r\n', 'gg', 'gg', 0, '0', '2018-02-23 08:25:02', '2018-02-23', ''),
(4, 'ព្រះទីនាំង ច័ន្ទឆាយា', '.', '.', '20180223_6905_3. Chroy Changvar.png', '.', '.', '.', '<p><img alt=\"\" src=\"/www/Project/project_OCIC/project_OCIC/plugin/ckeditor_4.7.0_full/kcfinder-master/upload/images/chroy_congva_city/Cormercial_CCV1.jpg\" style=\"width:100%\" /></p>\r\n\r\n<p>Welcome to the land of golden opportunity in the prime area by the Tonle Sap River. &nbsp; A brighter future awaits you here at Chroy Changvar: City of the Future<br />\r\nChroy Changvar will be a new international business district that fulfills all desires in regards to trade, economy, and way of life, and enables it to attract both local and international investors, creating considerable economic growth and substantially improved living standards.</p>\r\n\r\n<p><img alt=\"\" src=\"/www/Project/project_OCIC/project_OCIC/plugin/ckeditor_4.7.0_full/kcfinder-master/upload/images/chroy_congva_city/Picture6.jpg\" style=\"width:100%\" /><br />\r\nChroy Changvar will be the &lsquo;Crown Jewel&rsquo; of Phnom Penh and Cambodia complemented by comprehensive transportation and logistics networks of GMS, including the Southern Economic Corridor (SEC) which creates absolute accessibility and connectivity as well as opens the door for opportunities for trading and investment for the entire region, making it one of the new economic hubs when AEC integration fully integrates.</p>\r\n\r\n<p><img alt=\"\" src=\"/www/Project/project_OCIC/project_OCIC/plugin/ckeditor_4.7.0_full/kcfinder-master/upload/images/chroy_congva_city/Picture7.jpg\" style=\"width:100%\" /><br />\r\nAs part of this project, over 200 hectares of land will be transformed into a &ldquo;City of the Future&rdquo;. This &ldquo;city within a city&rdquo; is to be comprised of a vibrant commercial zone, a prominent business zone, and a not-to-be-missed tourist destination. It will also offer a prime area for exclusive living and working, and ultimately there will be happiness amidst green and pristine conditions.</p>\r\n\r\n<p><img alt=\"\" src=\"/www/Project/project_OCIC/project_OCIC/plugin/ckeditor_4.7.0_full/kcfinder-master/upload/images/chroy_congva_city/Picture8.jpg\" style=\"width:100%\" /></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><br />\r\n&nbsp;</p>\r\n', '<div style=\"margin-bottom:0pt; margin-left:.38in; margin-top:4.32pt; text-align:left\"><span style=\"font-size:18.0pt\"><span style=\"font-family:Arial\">&bull;</span></span><span style=\"font-size:18.0pt\"><span style=\"font-family:Calibri\"><span style=\"color:black\">Welcome to the </span></span></span><span style=\"font-size:18.0pt\"><span style=\"font-family:Calibri\"><span style=\"color:black\"><strong>land of golden opportunity</strong></span></span></span><span style=\"font-size:18.0pt\"><span style=\"font-family:Calibri\"><span style=\"color:black\"> in the prime area by the </span></span></span><span style=\"font-size:18.0pt\"><span style=\"font-family:Calibri\"><span style=\"color:black\">Tonle</span></span></span><span style=\"font-size:18.0pt\"><span style=\"font-family:Calibri\"><span style=\"color:black\"> Sap River.&nbsp;&nbsp; A brighter future awaits you here at </span></span></span><span style=\"font-size:18.0pt\"><span style=\"font-family:Calibri\"><span style=\"color:black\">Chroy</span></span></span> <span style=\"font-size:18.0pt\"><span style=\"font-family:Calibri\"><span style=\"color:black\">Changvar</span></span></span><span style=\"font-size:18.0pt\"><span style=\"font-family:Calibri\"><span style=\"color:black\">: City of the Future</span></span></span></div>\r\n\r\n<div style=\"margin-bottom:0pt; margin-left:.38in; margin-top:4.32pt; text-align:left\"><span style=\"font-size:18.0pt\"><span style=\"font-family:Calibri\"><span style=\"color:black\"><img alt=\"\" src=\"/www/Project/project_OCIC/project_OCIC/plugin/ckeditor_4.7.0_full/kcfinder-master/upload/images/Cormercial_CCV1.jpg\" style=\"width:100%\" /></span></span></span></div>\r\n\r\n<div style=\"margin-bottom:0pt;